import { Display } from "./Display"
import { Input } from "./Input"
import { Time } from './Time'
import { AppBar , Toolbar , Typography} from '@material-ui/core'
import { BsCardChecklist } from 'react-icons/bs'
import { useLogin } from './Context'
import './Styles/App.css'
export const App = () => {
  const {lastLogin} = useLogin()

  function showLastLogin () {
    if(lastLogin.count>1){
      return(
        <div>{ lastLogin.time }</div>
      )
    }
    else{
      return(
        <div>{"-"}</div>
      )
    }
  }

  return(
    <>
    <AppBar position='relative' style={{backgroundColor:'#001f3f'}}>
      <Toolbar>
      <BsCardChecklist style={{marginRight:'2vh' , fontSize:'10vh'}}/>
      <Typography variant='h5'style={{paddingRight:'2rem'}}> Task Manager App </Typography>
      <Time />
      </Toolbar>
    </AppBar>
    <div className = 'root'>
      <div className='container'>
          <Input/>
          <Display/>
      </div>
    </div>
    </>
  )
}
